import React, { useEffect, useState } from "react";

export const UserForm = () => {
    const [form, setForm] = UseState({
        name: '',
        password: ''
    })
    return (
        <div>
            <h1>Login</h1>
            <form>
                <label>
                    Username:
                    <input name="username" value={form.name} />  
                </label>
                <label>
                    Password:
                    <input name="password" value={form.password} />  
                </label>
                <button type="submit"/>
            </form>
        </div>
    )
}
